	public void pushWords(object sender, ElapsedEventArgs e) {
		count++;

		if (count <= ROW_MAX) {
			if (count != 0) {
				switch (count) {
				case 1:
					sizesToPush = 1900;
					break;
				case 2:
					sizesToPush = 850;
					break;
				default:
					sizesToPush = 1500 / count;
					break;
				}
			}
		
			if (count > 1)
				wordsToPush += "\n";

			wordsToPush += "" + ar_phrases360 [count - 1];

		} else {
			string [] abc = wordsToPush.Split(new string[] { "\n" }, StringSplitOptions.None);
			int k = (count + ROW_MAX - 1) % ROW_MAX;
			abc[k] += " " + ar_phrases360 [(count - 1) % ar_phrases360.Count];

			wordsToPush = abc[0];

			for (int i=1;i<abc.Length;i++) {
				wordsToPush += "\n" + abc[i];
			}

		}

	}

	// Update is called once per frame
	void Update () {
		if (isInLevel) {
			isInLevel = false;
			timer.Enabled = true;
		}

		popup_txt.fontSize = sizesToPush;
		popup_txt.text = wordsToPush;
	}
